webpackJsonp([0xa44eac3debb8],{411:function(e,i){e.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Сгибание рук у верхних блоков – это изолирующее дополнительное упражнение, направленное на проработку бицепса. Оно может выполняться как в положении стоя, так и сидя.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Установите подходящий Вам вес (одинаковый) с двух сторон тросового тренажера. Настройте тросы так, чтобы рукояти были выше Ваших плеч. Займите центральное положение в раме и возьмите рукояти таким хватом, чтобы ладони были направлены в сторону потолка.</li>\n<li>Исходное положение: поставьте ноги на ширине плеч, а тело держите на одной прямой с рукоятями.</li>\n<li>На выдохе – держа туловище неподвижно, плавно сгибайте руки до тех пор, пока предплечье не дотронется до бицепса.</li>\n<li>На вдохе – распрямите руки в локте.</li>\n<li>Выполните требуемое количество повторений.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/kDi6JRH_BlI" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/sgibania-ruk-u-verhnih-blokov-v-crossovere",efficiency:"6",title:"Сгибания рук у верхних блоков в кроссовере",image:"/3-06-0.png",image_2:"",image_3:"",image_4:"",filterby:"biceps",date:"April 12, 2017",injury:"4",bodypart:"Бицепс",filtertype:"isolated",type:"Изолирующее",filterinventory:"crossover",inventory:"Кроссовер",filterplace:null}}},pathContext:{}}}});
